sys_variable_value.value:
(function execute(inputs, outputs) {
  var vpc = new GoogleVPCUtils();
    vpc.validateInputVariables(inputs, outputs);
    vpc.validateMandatoryVariables(inputs, [ 'projectid', 'firewall']);
    vpc.maptoOutputFromInput(inputs, outputs, ['projectid', 'firewall']);
    vpc.createFirewallRule(inputs,outputs,'EGRESS')
})(inputs, outputs);

